import java.awt.Graphics;
import java.awt.Rectangle;
import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.util.Base64;
import java.util.Random;

import javax.imageio.ImageIO;

public class Asteroid {
	
	private double x, y, Length, rads, angle;
	MainPanel mainPanel;
	private static Random rand;
	private int rotation;
	
	BufferedImage image = null;
	BufferedImage d_image = null;
	
	public Rectangle getBounds() {
		return new Rectangle((int)x,(int)y, 64,64);
	}
	
	public double getX() {
		return x;
	}

	public double getY() {
		return y;
	}
	
	public String getExplosion() {
		return EXPLOSION;
	}

	public Asteroid(double x, double y, MainPanel mainPanel,int rotation ){
		if(rand == null)
			rand = new Random();
		angle = rand.nextInt(360);
		this.x = x;
		this.y = y;
		this.mainPanel = mainPanel;
		this.rotation = rotation;
		System.out.println(rotation);
		Length = Math.abs(this.x - (mainPanel.getWidth()/2));
		
		try {
			image = ImageIO.read(ImageIO.createImageInputStream(new ByteArrayInputStream(Base64.getDecoder().decode(ASTEROID))));
			d_image = ImageIO.read(ImageIO.createImageInputStream(new ByteArrayInputStream(Base64.getDecoder().decode(DEBRIS))));
		} catch (IOException e) {
			e.printStackTrace();
		}
	}
	
	
	public void tick() {
		if(!mainPanel.isPaused()) {
			angle += .5;
			if (angle > 360) {
                angle -= 360;
            }
			rads = Math.toRadians(angle);
	
			if(rotation == 1 || rotation == 4 || rotation == 5 || rotation == 8) {
				x = ((mainPanel.getWidth()/2 + Math.cos(rads) * Length) - 32);
				y = ((mainPanel.getHeight()/2 - Math.sin(rads) * Length) - 32);
			} 
			else { 
				x = ((mainPanel.getWidth()/2 - Math.sin(rads) * Length) - 32);
				y = ((mainPanel.getHeight()/2 + Math.cos(rads) * Length) - 32);
			}
		
		}
	}
	
	public void drawDebris(Graphics g) {
		g.drawImage(d_image,(int) x,(int) y, (int) (64),(int) (64),  null);
	}
	
	public void draw(Graphics g) {
		g.drawImage(image,(int) x,(int) y, (int) (64),(int) (64),  null);
	}
	
	
	
	private static final String ASTEROID = "";	
	private static final String EXPLOSION = "";
	private static final String DEBRIS = "";
}
